import React from 'react';
import { Button, ButtonProps as AntdButtonProps } from 'antd';


type ButtonProps = {
    label: string;
} & Pick<AntdButtonProps, 'type'>;

export const CButton: React.FC<ButtonProps> = ({ type = 'primary', label }) => {
    return <Button type={type}>{label}</Button>;
};
